import Timer from "./Timer/timer";
import React from "react";
import {useNavigate} from "react-router-dom";

const buttonNames = [
    'Seizure',
    'Heart Attack',
    'Stroke',
    'Choke',
    'Sugar',
    'Blood',
    'Asthma',
    'Broken Stuff',
];
const navigate = useNavigate();
function HandleClick() {

}
function HandleClickLogin(){
    navigate("/login");
}
function HandleClickRegister(){
    navigate("/register");
}
export function HomePage() {
    const buttons = buttonNames.map((name, index) => (
        <button key={index} className="button" onClick={HandleClick}>
            {name}
        </button>
    ));

    return (<div>
            <button id={'login'} className={"loginButton"} onClick={HandleClickLogin}>Login</button>
            <button id={'register'} className={"registerButton"} onClick={HandleClickRegister}>Register</button>
            <div className="button-container">
                {buttons}
                <div className="emergency-container">
                    <button className="emergency-button">EMERGENCY</button>
                </div>
                <Timer/>
            </div>
        </div>
    );
}

export default HomePage;
